                        $.each(d, function (i, product) {
                            ddlProduct.append($(""<op");
            WriteLiteral(@"tion></option>"").val(product.productId).html(product.productName))
                        });
                    },
                    error: function () {
                        alert('Error 500!');
                    }
                });
            }
        });

        $(""#ddlProduct"").change(function () {
            var ProductId = parseInt($(this).val());
            var ProductId = $('#ddlProduct option:selected').val();

            if (!isNaN(ProductId)) {
                var rate = $('#txtRate');

                $.ajax({
                    url: 'http://localhost:25825/Invoice/BindRateDetails',
                    type: 'GET',
                    data: { ProductId: ProductId },
                    success: function (d) {
                        rate.val(d);
                    },
                    error: function () {
                        alert('Error 500!');
                    }
                });
            }
        });
    });
